import React from 'react';

function TVShows() {
    return (
        <div style={{ padding: '20px', backgroundColor: '#212121', color: '#fff' }}>
            <h1>TV Shows</h1>
            <ul>
                <li>Breaking Bad</li>
                <li>Stranger Things</li>
                <li>The Witcher</li>
                <li>Game of Thrones</li>
            </ul>
        </div>
    );
}

export default TVShows;
